INSERT INTO `circles` VALUES (1,'One Story A Day','该系列内容引人入胜，生动有趣，且多富有启发和教育意义。题材丰富，涵盖面广。','http://grouppic.hexuexi.com:8089/u0/6034243778049515520.png',0,0,14,'23557',NULL,1,NULL,0,NULL,NULL,NULL),(2,'大学英语四级晨读菁华','《大学英语四级晨读菁华》精选74篇吻合四级难度的英语晨读文章，部分选文真题题源取材，','http://grouppic.hexuexi.com:8089/u0/6034243780054392832.png',0,0,0,'23717',NULL,1,NULL,0,NULL,NULL,NULL),(3,'开心写作文','开心写作文（初中版）','http://grouppic.hexuexi.com:8089/u0/6034243783195926528.png',0,0,0,'23936',NULL,1,NULL,0,NULL,NULL,NULL),(4,'认知高考18步 志愿填报不求人','本书视角多元、内容系统、分析专业、策略实用。从高校学科专业、人才培养，到高校招生政策、投档录取等与报考相关的诸多环节，向考生进行循序渐进、系统的介绍，并对考生常见问题提出针对性建议，为考生做好志愿填报提供参考策略。','http://grouppic.hexuexi.com:8089/u0/6034243829442322432.jpg',0,0,0,'24168',NULL,1,NULL,0,NULL,NULL,NULL),(5,'早上好中级','通过形式活泼的动画形式和有趣的主题内容消除孩子对单调学习语音的厌倦，达到较好的学习效果。','http://grouppic.hexuexi.com:8089/u0/6034243879945936896.png',0,0,0,'50423',NULL,1,NULL,0,NULL,NULL,NULL),(6,'现网test01','','http://grouppic.hexuexi.com:8089/u0/6034243882030505984.png',0,0,0,'24844',NULL,1,NULL,0,NULL,NULL,NULL),(19,'初一语文上同步影视二','包含以下具体视频条目：选读课文、夜雨寄北, 选读课文、天上的街市, 选读课文、如梦令, 选读课文、泊秦淮, 选读课文、西江月, 选读课文、观书有感, 选读课文、过故人庄, 选读课文、送灵澈上人, 选读课文、闻王昌龄左迁龙标遥有此寄, 选读课文、题破山寺后禅院, 选读课文、风筝, 选读课文、龟虽寿.','http://grouppic.hexuexi.com:8089/u0/6034243884031188992.png',0,0,0,'50793',NULL,1,NULL,0,NULL,NULL,NULL),(20,'六年级科学下同步影视','包含以下具体视频条目：第20课、《庄子》故事两则01, 第20课、《庄子》故事两则02, 第21课、曹刿论战01, 第22课、邹忌讽齐王纳谏, 第24课、《诗经》两首01, 第24课、《诗经》两首02, 第24课、《诗经》两首03, 第24课、《诗经》两首04, 第24课、《诗经》两首05, 第5课、孔乙己03, 第7课、变色龙, 第13课、威尼斯商人03, 第17课、公输《墨子》04, 第18课、《孟子》两章03--《得道多助失道寡助》, 第19课、鱼我所欲也《孟子》03, 第21课、曹刿论战','http://grouppic.hexuexi.com:8089/u0/6034243927949746176.png',0,0,0,'51035',NULL,1,NULL,0,NULL,NULL,NULL),(21,'加博初级英语','本课程通过培养儿童英语学习兴趣，掌握英语自然拼读规律，看到任何单词都能很自然知道它的发音。练习英语语腔语调，掌握更多简单句型。学会肯定、否定、疑问句使用。增加新的日常用词汇。','http://grouppic.hexuexi.com:8089/u0/6034243931225497600.png',0,0,0,'84744',NULL,1,NULL,0,NULL,NULL,NULL),(22,'小学数学精讲视频二','包含以下具体视频条目：多位数乘一位数, 负数, 毫米 分米 千米, 计算工具的认识, 简易方程, 角的度量与分类, 角的画法, 近似数, 面积, 平行四边形, 平行四边形与梯形,认识乘法, 认识除法, 软件上下 前后 左右位置, 三角形, 三位数与两位数的乘积, 四则混合运算。','http://grouppic.hexuexi.com:8089/u0/6034243933356204032.png',0,0,0,'86110',NULL,1,NULL,0,NULL,NULL,NULL),(23,'小学语文精讲视频','包含以下具体视频条目：2标点, 3标点, 标点1, 查字典和词典, 词  语, 词语搭配, 汉语拼音, 句 子(二), 句 子(一), 口语交际, 巧做阅读理解题, 识字与写字, 习作1, 习作2, 修辞方法, 阅读理解, 阅读理解题型解析, 直播课堂--古诗文的阅读。','http://grouppic.hexuexi.com:8089/u0/6034243935482716160.png',0,0,0,'86197',NULL,1,NULL,0,NULL,NULL,NULL),(24,'初中科学','该课程以科学性、教育性、趣味性、实践性和综合性为原则，通过老师和同学，同学与同学之间的互动，增强学生学习课本中的各种科学知识的兴趣，从而达到更好的学习状态，并以此提升学生对该科学课程的专注性。','http://grouppic.hexuexi.com:8089/u0/6034243978281394176.png',0,0,0,'87448',NULL,1,NULL,0,NULL,NULL,NULL),(25,'小学体育','该课程通过一些简单的游戏运动，如木上平衡、前滚翻逃出险境、山羊分腿腾跃等来增强学生的体格锻炼，促进学生身体发育和健康成长。','http://grouppic.hexuexi.com:8089/u0/6034243980340797440.png',0,0,0,'87489',NULL,1,NULL,0,NULL,NULL,NULL),(26,'初中语文','本课程主讲文章赏析和叙事写人作文指导，通过对不同文章的深入理解，了解不一样的写作手法和修辞手法。识记常用的文言词语，感受优秀作文的语言气息；掌握刻画人物的方法写出人物的个性。','http://grouppic.hexuexi.com:8089/u0/6034243982437949440.png',0,0,0,'87535',NULL,1,NULL,0,NULL,NULL,NULL),(27,'初中科学','本课程涵盖了杠杆内容、光的传播、激素的发现和应用、图表的理解、影响导体电阻大小的因素等内容。通过复习引入、演示实验、补充阅读循序渐进的教学方式，使学生学会观察、比较、分析和综合。','http://grouppic.hexuexi.com:8089/u0/6034243984358940672.png',0,0,3,'87533',NULL,1,NULL,0,NULL,NULL,NULL),(28,'初中信息技术','本课程主要包含了excel表、逐帧动画、封面、ppt制作等知识，采用了直接有效的学生体验、教师讲解、学生操作的方式。以达到掌握更多信息技术技能的目的。','http://grouppic.hexuexi.com:8089/u0/6034244011860992000.png',0,0,0,'87648',NULL,1,NULL,0,NULL,NULL,NULL),(29,'2015国考行测真题','1．2015国考真题讲解2．提供详细国考真题解析3．公考微视频4．零基础学员一学就会','http://grouppic.hexuexi.com:8089/u0/6034244028772425728.png',0,0,0,'89748',NULL,1,NULL,0,NULL,NULL,NULL),(30,'高考辅导（英语）','通过认真研读辽宁高考英语大纲，着重就阅读理解中的细节理解和综合判断两种题型加以总结归纳，提升高三学生的阅读备考能力。课堂中分析近三年辽宁英语试卷中此两种类型题的分布情况，总结归纳设题的形式和特点，解题策略和答题方法，并分别分析正确选项和错误选项的设置特点，结合文章，寻找细节难题的攻略技巧，对难题的解答进行突破，且结合历届高考题进行实战演练，提高学生考试中这两种题型的解题速度，提升精准程度。','http://grouppic.hexuexi.com:8089/u0/6034244030810857472.png',0,0,0,'90558',NULL,1,NULL,0,NULL,NULL,NULL),(31,'初中数学','初中数学七年级下册教材中的图形与变换部分内容进行系统复习。内容涉及第二章《相交线与平行线》，第三章《三角形》，第五章《生活中的轴对称。课程设置以各章基础知识为依据，构建整章知识框架图，将相关基础知识以考点形式呈现，引导学生以例题题为依托，构建完善各章知识体系，提高学生的分析问题解决问题的能力。','http://grouppic.hexuexi.com:8089/u0/6034244032849289216.png',0,0,0,'90584',NULL,1,NULL,0,NULL,NULL,NULL),(32,'豚宝宝快乐认知分级阅读第2级','这是豚宝宝快乐认知分级阅读系列的第1级，我们专为3-7岁儿童精心打造的阶梯阅读产品，给孩子提供“看、听、读、做”四合一的分级视频读物。我们主张“创想”和“乐读”，强调“博学”和“动手”，鼓励“用眼观察、用手操作、用脑思考、用心感受和分享”，让孩子学会观察和想象，让孩子爱上阅读。','http://grouppic.hexuexi.com:8089/u0/6034244034971607040.png',0,0,0,'91192',NULL,1,NULL,0,NULL,NULL,NULL),(33,'高中数学','通过问题篇、知识篇、方法篇、综合篇、应用篇五个教学环节，进一步加深对古典概型、几何概型的认识和理解，扫除思维盲点，梳理概率与其它知识的联系，结合实例学以致用，逐步认识概率是研究随机事件的学科，提供认识世界的重要思维模式和解决问题的方法，培养用数学的眼光、视角认识、了解、分析世界的习惯，同时获得学习快乐，激发学生学习热情。','http://grouppic.hexuexi.com:8089/u0/6034244078957273088.png',0,0,0,'91276',NULL,1,NULL,0,NULL,NULL,NULL),(34,'华为NIP Manager安装培训','本课程介绍了NIP Manager安装步骤。学完本课程后，学员能够掌握NIP Manager安装操作。','http://grouppic.hexuexi.com:8089/u0/6034244081050230784.png',0,0,0,'91693',NULL,1,NULL,0,NULL,NULL,NULL),(35,'数据中心安全方案设计','本课程主要介绍数据中心安全概念和安全趋势、数据中心安全架构设计、数据中心安全最佳实践等。学习完本课程后，您应该能：描述数据中心安全设计原则；描述数据中心安全设计方案；描述数据中心安全威胁和防护方法；描述数据中心基础设施安全方案；描述数据中心网络层安全方案；描述数据中心主机、应用安全方案。','http://grouppic.hexuexi.com:8089/u0/6034244083126411264.png',0,0,0,'92028',NULL,1,NULL,0,NULL,NULL,NULL),(36,'职场指南——诚信是金','具体包括企业诚信成就品牌价值、员工诚信累加个人价值、谨守诚信的讲解。','http://grouppic.hexuexi.com:8089/u0/6034244085286477824.png',0,0,0,'92233',NULL,1,NULL,0,NULL,NULL,NULL),(37,'你好宝贝','邀请北京各大医院教授、高校学者、权威教团体及育专家参与拍摄，结合儿童在不同时期的生长发育特点，综合展示教育学、心理学、应用医学等方面与儿童发育、发展间的新研究、新科技。利用起承转合的专家采访，完成故事情节与知识铺陈的衔接，科学地展示与挖掘专业领域内深层知识原理。','http://grouppic.hexuexi.com:8089/u0/6034244131453181952.png',0,0,0,'27628',NULL,1,NULL,0,NULL,NULL,NULL),(38,'初二物理轻松学','初二了，小伙伴们刚刚接触物理，还不适应的童鞋不要急躁，老师帮你梳理重难点题目，突破关键点，轻松搞定初二物理学习。本课程包含了关于“长度和时间、平均速度、声现象以及物态变化”，这是初二物理学习的重难点，希望同学们一定要掌握。','http://grouppic.hexuexi.com:8089/u0/6034244133390950400.png',0,0,0,'27939',NULL,1,NULL,0,NULL,NULL,NULL),(39,'北京四中网校数学精品课程','课程讲解全面系统，对每个知识点和题型都进行系统性讲解，并有大量配套训练题目，让学员全面掌握高效的解题方法与技巧，兼具全面性、系统性、实战性。','http://grouppic.hexuexi.com:8089/u0/6034244135496491008.png',0,0,0,'27958',NULL,1,NULL,0,NUL