ULL),(119,'一年级语文下同步影视二','包含以下具体视频条目：第3组--识字3, 第9课、两只鸟蛋01, 第9课、两只鸟蛋02, 第10课、松鼠和松果, 第11课、美丽的小路01, 第11课、美丽的小路02, 第12课、失物招领01, 第12课、失物招领02, 第13课、古诗两首--《所见》01, 第13课、古诗两首--《所见》02, 第13课、古诗两首--《小池》01, 第13课、古诗两首--《小池》02, 第14课、荷叶圆圆01, 第14课、荷叶圆圆02, 第15课、夏夜多美01, 第15课、夏夜多美02, 第16课、要下雨','http://grouppic.hexuexi.com:8089/u0/6034245940808818688.png',0,0,0,'70173',NULL,1,NULL,0,NULL,NULL,NULL),(120,'核心词汇的记忆方法','智课网(SmartStudy)北美词汇精品课堂，由国内词汇名师，具有丰富的托福，雅思，专四专八词汇教学经验的曲根老师主讲。系统地介绍了单词的记忆方法和有效的复习方式，包括词根词缀法，词源法，字母组合法等，并结合具体的单词进行清晰的说明解释，让考生对每种方法有明确的了解和大致的掌握。然后对所有的北美词汇逐词详解，并逐一归入相应的记忆方式，拆分讲解，在探讨每个单词的结构和组成方式中找到记忆规律，活学活用，避免生疏的死记硬背。','http://grouppic.hexuexi.com:8089/u0/6034245944407531520.png',0,0,0,'71939',NULL,1,NULL,0,NULL,NULL,NULL),(121,'北美留学考试与申请','小宝老师韦晓亮6小时系统讲解高中生申请美国本科全程时间规划','http://grouppic.hexuexi.com:8089/u0/6034245946219470848.png',0,0,0,'71940',NULL,1,NULL,0,NULL,NULL,NULL),(122,'看电影学英语','智课网（SmartStudy）看电影学英语精品课堂，由电影方法研究者、英语教学专家许岑老师讲授。本课程属于非应试类的方法精讲类课程，精选十多部电影中尤其适合英文学习的诸多片段，深度剖析电影片段的剧情、人物性格、人物关系、语言、文化和练习方法，强调带着情感体验（GetEmotionallyInvolved）来学习电影中的词汇、句型和多种表达方式，通过模仿、录音（录像）和反复比对的方法强化输出能力。从情感代入到技巧训练，再到西方文化的深入了解与习得，本课程生动并系统地讲解了正确高效地看电影学英语的方','http://grouppic.hexuexi.com:8089/u0/6034245948023021568.png',0,0,0,'71938',NULL,1,NULL,0,NULL,NULL,NULL),(123,'欢乐动植物','本课程主要介绍动植物的英语课程。老师以轻松又有趣的方式，介绍了各种动植物的英语，并且从动植物的英语，延伸学习了更多英语知识，像动物的各种习性的英语表达方式等等。','http://grouppic.hexuexi.com:8089/u0/6034245991127883776.png',0,0,0,'73079',NULL,1,NULL,0,NULL,NULL,NULL),(124,'认识上学与交通','本课程，学生可以学到交通工具、交通标志、方位、学习用品，以及上音乐课和体育课等等的英语知识，既丰富了学生对上学和交通的认识，也让学生的英语知识得到更好的提高。学习英语从身边的事物开始。','http://grouppic.hexuexi.com:8089/u0/6034245993006931968.png',0,0,0,'73078',NULL,1,NULL,0,NULL,NULL,NULL),(125,'情景对话','本课程专题，教同学们学会日常生活中所用到的英语情景对话，包括家庭生活对话、节日问候对话、饮食情景对话和旅游情景对话等等，让同学们真正能学以致用，打破英语对话的零壁垒。','http://grouppic.hexuexi.com:8089/u0/6034245994781122560.png',0,0,0,'73126',NULL,1,NULL,0,NULL,NULL,NULL),(126,'如何做合格爸爸','做合格爸爸，不仅仅是能赚钱，养家糊口，还能懂得怎样教育孩子，培养孩子独立的人格，不仅要学会书本的知识，更好教会孩子社会的锻炼等。','http://grouppic.hexuexi.com:8089/u0/6034245996572