INSERT INTO `biggie` VALUES ('林志玲','http://articleimg.xbiao.com/2015/1124/201511241448361426416.jpg','湾湾第一美女','林志玲，女，1974年11月29日出生于台湾省台北市，毕业于加拿大多伦多大学，中国台湾的女艺人、演员、模特、歌手、主持人。','http://baike.baidu.com/link?url=Es4NkJGrXJmzY0McTzsRu8qjO9_TmoW-hd6GxvSNEczT_X2CZgFB8gjM6ugzmcOlO7deQU8sy2z-tbyj46MG2q',2,2,1,'admin',1450853398,1,'admin',1450943775,1,'2015-12-23 14:49:58','2015-12-24 15:56:14'),('周迅','http://upload.ct.youth.cn/2015/0101/1420125471347.png','四大花旦之一','周迅，1974年10月18日生于浙江省衢州市，中国内地女演员。1991年因出演电影《古墓荒斋》而出道。1998年周迅凭借《苏州河》获得巴黎国际电影节影后及法国演艺集团最具潜力新人奖。2000年因电视剧《大明宫词》小太平一角获得中国电视金鹰奖最受欢迎女演员。2001年参演的电影《十七岁的单车》获得第51届柏林国际电影节银熊奖；2003年主演的《巴尔扎克与小裁缝》代表法国获得第61届金球奖最佳外语片提名。2005年凭借电影《如果·爱》获得香港电影金像奖、台湾电影金马奖等奖项。','http://baike.baidu.com/link?url=Y6-HZdnGRF3BoRdLYEdoUgYCAqqeKO9NtCaUModkk5eEGagOFeXEJmYBgzRhqs5hP29450Wasg6Qf47g5PgpjZKxB2g5Ynn_ncR2XTKJOt3',5,2,1,'admin',1450853398,1,'admin',1450943780,2,'2015-12-23 14:49:58','2015-12-24 15:56:20'),('孙红雷','http://www.chinanews.com/cul/2010/09-17/U136P4T8D2539394F116DT20100917110305.jpg','当红小生','孙红雷，1970年8月16日出生于黑龙江省哈尔滨市，中国影视男演员。1997年毕业于中央戏剧学院表演系。','http://baike.baidu.com/link?url=KymrSQVBnCFM-8XysW9DDegFhVwBEraVpMxCMozhfhXiGKhAOBNBOvntAgC21dbcvZL0nV3BqRZJVZYrauJTY_',4,2,1,'admin',1450853398,1,'admin',1450943778,3,'2015-12-23 14:49:58','2015-12-24 15:56:18'),('汤唯','http://www.xnnews.com.cn/yl/ylrdjj/201211/W020121128603570067239.jpg','当红女演员','汤唯，1979年10月7日出生于浙江省杭州市，中国影视女演员。2000年考入中央戏剧学院导演系本科。','http://baike.baidu.com/link?url=amaPmBkhB58qaCiCCA91s0SYYxVOWl8fLadN2bCJP41m4VRZ9tYp4jBCFyXmdLbSao4Sxkmaez9vyVeivDzD_K',1,2,1,'admin',1450853398,1,'admin',1450928124,4,'2015-12-23 14:49:58','2015-12-24 11:35:24'),('Chris Hemsworth','http://img2.ph.126.net/nNs8BdzTfFNL8BT6oolSrw==/62768919824068790.jpeg','雷神, 锤子','克里斯·海姆斯沃斯（Chris Hemsworth），1983年8月11日在墨尔本出生，澳大利亚演员。2011年，克里斯出演了好莱坞电影《雷神》，并凭借雷神一角成为好莱坞明星。','http://baike.baidu.com/link?url=XBrmRSqGm4AL7UyttMCQCPFEPIl0lw0BsvRnxdalKIJifwMZ2-NDKV9YMJ6Rwva8fpE4tnwwZGvB52TRpjIEJK',6,2,1,'admin',1450853398,1,'admin',1450943782,5,'2015-12-23 14:49:58','2015-12-24 15:56:22'),('吴晓波','https://ss0.bdstatic.com/70cFuHSh_Q1YnxGkpoWK1HF6hhy/it/u=980639219,1171713113&fm=116&gp=0.jpg','财经作家','吴晓波，1968年生人，毕业于复旦大学新闻系。财经作家，“蓝狮子”财经图书出版人，曾任上海交通大学、暨南大学EMBA课程教授，常年从事公司研究。2009年被《南方人物周刊》评为年度“中国青年领袖”。','http://baike.baidu.com/link?url=V5SmxjxknhEYBN4XuZHZcTrMei_MzchLnokAamLYKSjbPcTlMldDETWsyhY9GCKV4SbuCcAhdfYxrCOPVc7Qz9b4D9d4NkXjgLqeHPsETjW',3,2,1,'admin',1450927402,1,'admin',1450943776,6,'2015-12-24 11:23:22','2015-12-24 15:56:16'),('韦晓亮','http://119.254.100.252:4010/upload/image/upload_3cddbf5dbbde3e4cf5d6363c463d08cc.jpg','智课网','GRE、GMAT、TOEFL写作教学权威，原新东方集团品牌教师。教学经验9年，培训学员超过12万人。国外考试教学及留学文书写作专家。智课网创始人。','http://m.miguxue.com/emall/p/detail.jsp?cid=104028',5,1,1,'admin',1450943769,1,'admin',1451439966,7,'2015-12-24 15:56:08','2015-12-30 09:46:05'),('彭新松','http://119.254.100.252:4010/upload/image/upload_d377da24aa9bda2b549239d3fc419feb.jpg','智课网','智课网雅思名师，著有《考研听力速成》、《雅思考试听力理解》等书。中国雅思听力第一人，从教十余年，对雅思听力考试了如指掌。','http://m.miguxue.com/emall/p/detail.jsp?cid=253160',2,1,1,'admin',1450943853,1,'admin',1451439966,8,'2015-12-24 15:57:32','2015-12-30 09:46:05'),('曲根','http://119.254.100.252:4010/upload/image/upload_28789f341ff15f5867ece8ee0d89be05.jpg','智课网','新东方名师，多次获得大学英语演讲比赛以及各种全国英语竞赛一等奖。授课风格活泼，思路清晰，有自己独到的见解。主讲核心词汇记忆方法。','http://m.miguxue.com/emall/p/detail.jsp?cid=253160',6,1,1,'admin',1450943912,1,'admin',1451439966,9,'2015-12-24 15:58:31','2015-12-30 09:46:05'),('谢欣欣','http://119.254.100.252:4010/upload/image/upload_23775921ae291b015af09845acc28119.jpg','智课网','曾获CCTV杯全国英语演讲大赛江西省一等奖、第21期新东方全国新教师说课大赛第二名。参与考研词汇《恋恋有词》一书编写。','http://m.miguxue.com/emall/p/detail.jsp?cid=187523',4,1,1,'admin',1450943958,1,'admin',1451439966,10,'2015-12-24 15:59:18','2015-12-30 09:46:05'),('张家铭','http://119.254.100.252:4010/upload/image/upload_790f34f31a9114bed56eaf55647ce5f4.jpg','新东方在线','国内词汇教学权威，主讲GRE、托福、SAT、雅思词汇，原北京新东方词汇项目主管，原新东方集团品牌词汇教师。七年教学经验，培训学员超过8万人。','http://m.miguxue.com/emall/p/detail.jsp?cid=285919',3,1,1,'admin',1450944003,1,'admin',1451439966,11,'2015-12-24 16:00:03','2015-12-30 09:46:05'),('吴晓波','http://119.254.100.252:4010/upload/image/upload_485f758a5830899aa2bfbd43e2aa0abe.jpg','蓝狮子','“蓝狮子”财经图书出版人，财经作家，2009年被《南方人物周刊》评选为中国青年领袖。通过对热点及历史事件的深入挖掘与分析传授枯燥乏味的财经知识。','http://m.miguxue.com/emall/p/detail.jsp?cid=204705',1,1,1,'admin',1450944676,1,'admin',1451439982,12,'2015-12-24 16:11:15','2015-12-30 09:46:21'),('梁伟伟','http://119.254.100.252:4010/upload/image/upload_dcaa39a39e7fa74b503aca77a53ed7cd.jpg','万学教育','中国著名考研辅导专家，连续三年担任教育部直属机构主办的全国研究生咨询大会特邀专家。深受广大考研学生的喜爱与追捧。','http://m.miguxue.com/emall/p/detail.jsp?cid=334151',7,1,1,'admin',1450944795,1,'admin',1451549389,13,'2015-12-24 16:13:15','2015-12-31 16:09:48'),('微小微','http://119.254.100.252:4010/upload/image/upload_182b23f2e348243398364a1fd282a669.jpg','杭州数品','微博红人，舞蹈爱好者，以其自制的韩舞视频深受网友喜爱，在2013年获得“优酷舞蹈牛人”称号，后凭借《小苹果》舞蹈模仿秀一举成名。','http://m.miguxue.com/emall/p/detail.jsp?cid=327034',8,1,1,'admin',1450944884,1,'admin',1451549429,14,'2015-12-24 16:14:43','2015-12-31 16:10:28'),('张凌华','http://119.254.100.252:4010/upload/image/upload_abffab266290d956e47487d590bbd215.jpg','麦子学院','麦子学院CEO，麦可网创始人，Android开发联盟创始人。拥有14年的软件项目开发设计经验，8年的技术管理经验。对于IT开发领域的独到切深入的见解。','http://m.miguxue.com/emall/p/detail.jsp?cid=93628',9,1,1,'admin',1450945013,1,'admin',1451549481,15,'2015-12-24 16:16:53','2015-12-31 16:11:20'),('仲理峰','http://119.254.100.252:4010/upload/image/upload_ca6fbf21be26778ffda3e2162edc4b5a.jpg','中文在线','北京大学光华管理学院人力资源管理与组织行为博士后，中国人民大学商学院教授。通过专业，严谨的讲学风格使学生对于企业管理有系统深入的认识。','http://m.miguxue.com/emall/p/detail.jsp?cid=96217',10,1,1,'admin',1450945083,1,'admin',1451549519,16,'2015-12-24 16:18:02','2015-12-31 16:11:59'),('纪连海','http://119.254.100.252:4010/upload/image/upload_4e2193594c80d51297186b4712527015.jpg','山东广电','北京师大二附中高级教师，北京市骨干教师，超级学术明星，被誉为《百家讲坛》“十大名嘴”中的“最另类”。','http://m.miguxue.com/emall/p/detail.jsp?cid=331287',11,1,1,'admin',1450945188,1,'admin',1451549554,17,'2015-12-24 16:19:47','2015-12-31 16:12:34'),('鲍鹏山','http://119.254.100.252:4010/upload/image/upload_6e10bc17d0f81d23cd691a72274a7d3f.jpg','山东广电','文学博士、作家、学者，《百家讲坛》主讲《新说水浒》，人气爆棚！','http://m.miguxue.com/emall/p/detail.jsp?cid=308511',12,1,1,'admin',1450945290,1,'admin',1451549596,18,'2015-12-24 16:21:30','2015-12-31 16:13:16'),('郦波','http://119.254.100.252:4010/upload/image/upload_911c3992050c11e01c005e33a6186f6c.jpg','山东广电','《万家灯火》主讲，《百家讲坛》栏目主讲人，电视讲坛之“鬼才”。','http://m.miguxue.com/emall/p/detail.jsp?cid=309011',13,1,1,'admin',1450945363,1,'admin',1451549620,19,'2015-12-24 16:22:43','2015-12-31 16:13:39'),('朱高正','http://119.254.100.252:4010/upload/image/upload_1e2c6af5180f15777ddcb238b24a1ce9.jpg','山东广电','哲学博士，朱熹第26代嫡孙，研究朱熹及《易经》多年，所著《周易六十四封通解》被评为现代最佳易学著作。','http://m.miguxue.com/emall/p/detail.jsp?cid=331337',14,1,1,'admin',1450945432,1,'admin',1451549661,20,'2015-12-24 16:23:51','2015-12-31 16:14:20'),('傅佩荣','http://119.254.100.252:4010/upload/image/upload_61f18d3a82a82cdc48455feb71d19ecd.jpg','山东广电','中国讲师网500强品牌讲师，在《百家讲坛》、《世界文明讲坛》等多个电台主讲。被誉为“影响全球华人的国学导师，身心灵整合导师、哲普大师”。','http://m.miguxue.com/emall/p/detail.jsp?cid=331337',15,1,1,'admin',1450945499,1,'admin',1451549708,21,'2015-12-24 16:24:58','2015-12-31 16:15:07'),('蒙曼','http://119.254.100.252:4010/upload/image/upload_a4771ee50aa3c7f74d612d26e89c01b7.jpg','山东广电','中央民族大学历史系副教授、北京大学博士，写有隋唐的多部著作，《百家讲坛》主讲《武则天》、《长恨歌》等。','http://m.miguxue.com/emall/p/detail.jsp?cid=331402',16,1,1,'admin',1450945587,1,'admin',1451549996,22,'2015-12-24 16:26:27','2015-12-31 16:19:56');
